                    'thumbnails': {
                        w160: 'http://placekitten.com/160/163'
                    },
                    'filename': 'http://placekitten.com/2039/1920',
                },
            ],
        };
    }
  render() {
    return (
      <div className="App">
          <table>
              <tbody>
              {this.state.picArray.map(function(item, key) {

                  return (
                      <tr key = {key}>
                          <td>
                              <img src={item.thumbnails.w160}/>
                          </td>
                          <td>
                              <h3>{item.title}</h3>
                              <p>{item.description}</p>
                          </td>
                          <td>
                              <a href={item.filename}> linkki</a>
                          </td>
                      </tr>
                  )

              })}
              </tbody>
          </table>
      </div>
    );
  }
}

export default App;
